const brandTitle = 'data:image/png;base64,';

let style_12 = `
    display: flex;
    justify-content: center;
    text-align: center;
    padding: 20px 0px;
  `;

let style_04 = `
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
`;
function generateFooter(version, date){

  return `
    <div class="col-md-12" style="${style_12}">
      <div class="col-md-4" style="${style_04}">
        <img class="img-responsive" src="${brandTitle}">
        <p>Release: ${version} | ${date}</p>
      </div>
    </div>
  `;
}

exports.generateFooter = generateFooter;



